import { useEffect } from "react";
import {
  fetchPersonData,
  selectPersonBasics,
} from "../../../../store/basic-infos/basic-info-slice";
import { fetchDataDemo } from "../../../../store/basic-infos/basic-infos-action";
import { useAppDispatch, useAppSelector } from "../../../../store/resume-hooks";

import Card from "../../../ui/card/Card";

import "./name.scss";

type NameProps = {
  firstName: string;
  middleName: string;
  lastName: string;
  role: string;
};

function Name(props: NameProps) {
  const dispatch = useAppDispatch();
  const person = useAppSelector(selectPersonBasics);

  useEffect(() => {
    dispatch(fetchPersonData);
    console.log("useeffect");
  }, [person]);

  return (
    <Card className="name">
      <div className="name__container">
        <div className="name__container-group">
          <p className="name__container-group-firstname">{person.first_name}</p>
          <p className="name__container-group-middlename">{props.middleName}</p>
          <p className="name__container-group-lastname">{props.lastName}</p>
        </div>
        <p className="name__container-role">{props.role}</p>
      </div>
    </Card>
  );
}

export default Name;
